if (includedNames != null ? includedNames.isEmpty() : true) {
    return collectors().iterator();
} else {
    java.util.HashSet<io.prometheus.client.Collector> collectors = new java.util.HashSet<io.prometheus.client.Collector>();
    synchronized(namesToCollectors) {
        for (java.util.Map.Entry<java.lang.String, io.prometheus.client.Collector> entry : namesToCollectors.entrySet()) {
            if (includedNames.contains(entry.getKey())) {
                collectors.add(entry.getValue());
            }
        }
    }
    return collectors.iterator();
}
